import React from 'react';
import "./form fiel text.css"
import {useForm} from "react-hook-form";


function FormFieldText({title, type, id, name  }){
    const { register } = useForm();
    return(

        <label htmlFor={id}>
            {title}
        <input
            type={type}
            id={id}
            {...register({name})}

        />
    </label>

    )
};

export default FormFieldText
